        big_self[0]->_lf__reaction_0.chain_id = 1;
        // index is the OR of level 0 and 
        // deadline 140737488355327 shifted left 16 bits.
        big_self[0]->_lf__reaction_0.index = 0x7fffffffffff0000LL;
        
